import './app.scss';
import { Row, Container, Col } from "react-bootstrap";
import personal_photo from "./assets/personal_photo.jpeg";
import git_logo from "./assets/git_logo.png";
import React from "react";


const icons = [ 
	{
		icon_image: git_logo,
		url: "https://github.com/luismomm2110",
		description: "github"
	},
];


function Photo() {
    return (
        <React.Fragment>
            <Row className="photo-box"> 
                <img src={personal_photo} style={{ "height" : "100%" , "borderRadius" : "50%"}} alt = "personal" />
            </Row>
        </React.Fragment>
    )
}

function Icons({icons}) {
	return (
		<React.Fragment>
			{icons.map((icon) => (
				<a href={icon.url}><img className={"icon-image"} src={icon.icon_image} alt={icon.description} ></img></a>
			))
			}
		</React.Fragment>
	)
}

function App() {
  return (
<Container className={"container-main"} style={{height:"100vh"}} fluid>  
			<Row> 
				<Col className={"side-box"} lg={3} xs={1}>
				</Col>
				<Col  className={"center-box"} lg={6} xs={10}>
					<Photo />
					<Icons icons={icons} />
				</ Col> 
				<Col className={"side-box"} lg={3} xs={1}>
				</Col>
		</Row>
	</Container>
  );
}

export default App;
